  return (
    <div className="App">
   <ToastContainer theme='colored' position='top-right' style={{width:"400px",height:"30px"}}></ToastContainer>     <BrowserRouter>
  <Routes>  
  <Route path='/' element={<Home/>}></Route>
  <Route path='/login' element={<Login/>}></Route>
  <Route path='/register' element={<Register/>}></Route>


</Routes>
     </BrowserRouter>

    </div>
  );
}

export default App;
